import './App.css';
import DivWall from './components/divWall';
import Button from './components/button';

function App() {
  return (
    <>
      <div className="App">
          <label> Parede 1 </label>
          <DivWall />
        <div></div>
          <label> Parede 2 </label>
          <DivWall />
          <label> Parede 3 </label>
          <DivWall />
          <label> Parede 4 </label>
          <DivWall />
      </div>
      <div>
          <Button />
      </div>
    </>
  );
}

export default App;
